import './App.css';

function App() {
  return (
    <div className="App">
        <div className="header_logo"></div>
        <div className="header_cloud_providers"></div>
        <div className="header_account">
            <span className="span_account">Account</span>
            <span className="span_sign_in">Sign in</span>
        </div>
    </div>
  );
}

export default App;
